    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(i, curr, prev, res, op):
            if i == len(num):
                if curr == target:
                    res.append(op)
                return
            for j in range(i, len(num)):
                if j > i and num[i] == '0':
                    break
                curr = int(num[i:j+1])
                if op == None:
                    backtrack(j+1, curr, curr, res, num[i])
                else:
                    backtrack(j+1, curr, int(str(curr) + op + str(prev)), res, op + '*' + num[i])
                    backtrack(j+1, curr, int(str(prev) + op + str(curr)), res, op + '+' + num[i])
                    backtrack(j+1, curr, int(str(prev) + op + '-' + str(curr)), res, op + '-' + num[i])

        res = []
        backtrack(0, 0, 0, res, None)
        return res

