    def slidingPuzzle(self, board):
        """
        :type board: List[List[int]]
        :rtype: int
        """

        def swap(board, i, j):
            board[i], board[j] = board[j], board[i]
            return board

        def get_zero(board):
            for i in range(len(board)):
                for j in range(len(board[0])):
                    if board[i][j] == 0:
                        return i, j
            return None

        def get_neighbors(board):
            i, j = get_zero(board)
            neighbors = []
            if i > 0:
                neighbors.append(swap(board, i, j))
            if i < 1:
                neighbors.append(swap(board, i, j))
            if j > 0:
                neighbors.append(swap(board, i, j))
            if j < 2:
                neighbors.append(swap(board, i, j))
            return neighbors

        def get_goal(board):
            goal = [[1,2,3],[4,5,0]]
            return goal

        def get_distance(board, goal):
            distance = 0
            for i in range(len(board)):
                for j in range(len(board[0])):
                    if board[i][j] != goal[i][j]:
                        distance += 1
            return distance

        def solve(board):
            if board == get_goal(board):
                return 0
            neighbors = get_neighbors(board)
            min_distance = float('inf')
            for neighbor in neighbors:
                distance = solve(neighbor)
                if distance < min_distance:
                    min_distance = distance
            return min_distance + 1

        return solve(board)

